import React, { Component } from "react";
import "@popperjs/core";
import 'bootstrap/dist/css/bootstrap.min.css';
import ImageInputBox from './imageInputBox';
import 'Reservation.css';
import Radio from './radio';
import RadioGroup from './radioGroup';

class Reservation extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: new Date()

        };
    }
    render(){
        return(
            <div className="main">
                <div className="ment">
                    <p>예약상세</p>
                    <p>저장내용불러오기</p>
                    {/* <a href="#">저장내용불러오기</a> */}
                </div>
                <table className="table" style={{width:"1050px",height:"331.25px"}}>
                    <thead>
                            <tr>
                            <th class="table-active"scope="col">반려동물 이름</th>
                            <th scope="col">달구</th>
                            <th class="table-active" scope="col">이름</th>
                            <th scope="col">김미소</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <th class="table-active" scope="row">반려동물 종류</th>
                                <td>믹스견(장모종)</td>
                                <td class="table-active">전화번호</td>
                                <td>010-xxxx-xxxx</td>
                            </tr>
                            <tr>
                                <th class="table-active" scope="row">반려동물 성별</th>
                                <td>여(중성화)</td>
                                <td class="table-active">주소</td>
                                <td>부산광역시 동래구 000</td>
                            </tr>
                            <tr>
                                <th class="table-active" scope="row" rowSpan="3">메뉴선택</th>
                                <td colSpan="3">
                                    <tr>    
                                        <RadioGroup>
                                            <Radio name="species" value="ㄴmall" >
                                            중,소형견
                                            </Radio>
                                            <Radio name="species" value="big">
                                            대형견
                                            </Radio>
                                        </RadioGroup>
                                    </tr>
                                    <tr>
                                        <RadioGroup>
                                            <Radio name="cut" value="1" >
                                            가위컷
                                            </Radio>
                                            <Radio name="cut" value="2">
                                            기계컷
                                            </Radio>
                                            <Radio name="cut" value="3">
                                            스포팅
                                            </Radio>
                                            <Radio name="cut" value="4" >
                                            클리핑
                                            </Radio>
                                            <Radio name="cut" value="5" >
                                            부분미용
                                            </Radio>
                                        </RadioGroup>
                                    </tr>
                                    <tr>
                                        <RadioGroup>
                                            <Radio name="bath" value="bagic" >
                                            목욕
                                            </Radio>
                                            <Radio name="bath" value="healing">
                                            힐링스파
                                            </Radio>
                                            <Radio name="bath" value="carbonic acid">
                                            탄산스파
                                            </Radio>
                                        </RadioGroup>
                                    </tr>
                                    
                                </td>
                            </tr>
                        </tbody>
                </table>
                <button>다음</button>
            </div>

        )
    }
        
}


// function ReservationRequestBtn(){
//     return(
//         <select class="form-select" aria-label="Default select example">
//             <option selected>첫 방문이에요! 방문해서 상담할게요</option>
//             <option value="1">낯을 많이 가려요! 같이 보낸 애착 장난감과 함께 진행해주세요</option>
//             <option value="2">끝나면 바로 연락 주세요!</option>
//             <input value="3"></input>
//         </select>
//     )
// }

export default Reservation;
